import React from "react";
import { View, StyleSheet } from "react-native-web";
import {imagem} from "../../../assets/tela_principal.png"

const TelaPrincipal = () => {
    return (
        <View>
            <Image source = {imagem}/>
        </View>
    )
}

export default TelaPrincipal;

const estilos = StyleSheet.create({

    imagem: {
        width: "100%",
        height: "50%"
    }

})
